-- Table structure for `cf_areas`
-- ----------------------------
DROP TABLE IF EXISTS `cf_areas`;
CREATE TABLE `cf_areas` (
  `id` varchar(64) NOT NULL,
  `name` varchar(32) NOT NULL,
  `parent_id` varchar(64) NOT NULL,
  `short_name` varchar(16) NOT NULL,
  `level_type` int(11) unsigned NOT NULL,
  `city_code` varchar(16) NOT NULL DEFAULT '',
  `zip_code` varchar(16) NOT NULL DEFAULT '',
  `merger_name` varchar(64) NOT NULL,
  `position_x` decimal(16,12) NOT NULL,
  `position_y` decimal(16,12) NOT NULL,
  `pin_yin` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `parent_id` (`parent_id`,`level_type`),
  KEY `position_x` (`position_x`,`position_y`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='地区表';

