-- Table structure for `cf_auth`
-- ----------------------------
DROP TABLE IF EXISTS `cf_auth`;
CREATE TABLE `cf_auth` (
  `id` varchar(64) NOT NULL COMMENT '主键',
  `name` varchar(32) NOT NULL COMMENT '权限名称',
  `module` varchar(32) NOT NULL DEFAULT '' COMMENT '模块名称',
  `controller` varchar(64) NOT NULL DEFAULT '' COMMENT '控制器名称',
  `method` varchar(64) NOT NULL DEFAULT '' COMMENT '方法名称',
  `path` varchar(128) NOT NULL DEFAULT '' COMMENT '权限路径',
  `level` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '当前所处层级数',
  `description` varchar(64) NOT NULL DEFAULT '' COMMENT '权限描述',
