-- ----------------------------
-- Table structure for `cf_car_park`
-- ----------------------------
DROP TABLE IF EXISTS `cf_car_park`;
CREATE TABLE `cf_car_park` (
  `id` varchar(64) NOT NULL,
  `name` varchar(32) NOT NULL COMMENT '停车场名字',
  `image` varchar(256) NOT NULL DEFAULT '' COMMENT '停车场照片',
  `position_x` decimal(16,12) NOT NULL COMMENT '经度',
  `position_y` decimal(16,12) NOT NULL COMMENT '纬度',
  `start_business_hours` bigint(19) unsigned NOT NULL COMMENT '开始营业时间',
  `end_business_hours` bigint(19) unsigned NOT NULL COMMENT '结束营业时间',
  `parking_space_number` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '车位数',
  `used_parking_space_number` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '已用车位数',
  `address` varchar(64) NOT NULL DEFAULT '' COMMENT '停车场地址',
  `phone` varchar(11) NOT NULL DEFAULT '' COMMENT '手机',
  `landline` varchar(16) NOT NULL DEFAULT '' COMMENT '座机',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态(0-正常/1-车位已满/2-暂停营业)',
  `country_id` varchar(64) NOT NULL DEFAULT '' COMMENT '国家id',
  `province_id` varchar(64) NOT NULL DEFAULT '' COMMENT '省份id',
  `state_or_city_id` varchar(64) NOT NULL DEFAULT '' COMMENT '州或城市id',
  `zone_or_county_id` varchar(64) NOT NULL DEFAULT '' COMMENT '区或县id',
  `township_id` varchar(64) NOT NULL DEFAULT '' COMMENT '乡镇id',
  `free_time` bigint(19) unsigned NOT NULL DEFAULT '0' COMMENT '免费时长',
  `score` decimal(3,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '评分',
  `number_of_comments` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '评论数',
  `fee_upper_limit` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '单日费用封顶',
  `unit_duration` bigint(19) unsigned NOT NULL COMMENT '单位时长(单位-毫秒)',
  `billing_model` varchar(16) NOT NULL COMMENT '计费模式(static-静态/dynamic-动态)',
  PRIMARY KEY (`id`),
  KEY `start_business_hours` (`start_business_hours`,`end_business_hours`),
  KEY `country_id` (`country_id`,`province_id`,`state_or_city_id`,`zone_or_county_id`,`township_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='停车场表';

-- ----------------------------
-- Records of cf_car_park
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_car_park_car`
-- ----------------------------
DROP TABLE IF EXISTS `cf_car_park_car`;
CREATE TABLE `cf_car_park_car` (
  `id` varchar(64) NOT NULL,
  `number_plate` varchar(16) NOT NULL COMMENT '车牌号',
  `uid` varchar(64) NOT NULL COMMENT '汽车主人id',
  `image` varchar(128) NOT NULL DEFAULT '' COMMENT '图片',
  `brand` varchar(32) NOT NULL DEFAULT '' COMMENT '汽车品牌(缩写关键字)',
  `model` varchar(32) NOT NULL DEFAULT '' COMMENT '型号',
  `purchase_time` bigint(19) unsigned NOT NULL DEFAULT '0' COMMENT '购买时间',
  `price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '购买价格',
  `create_time` bigint(19) unsigned NOT NULL COMMENT '创建时间',
  `update_time` bigint(19) unsigned NOT NULL COMMENT '更新时间',
  `status` tinyint(3) unsigned NOT NULL COMMENT '状态(0-已删除/1-审核中/2-正常)',
  `identity_image` varchar(128) NOT NULL DEFAULT '' COMMENT '证件照',
  `identity_number` varchar(32) NOT NULL DEFAULT '' COMMENT '证件号',
  PRIMARY KEY (`id`),
  KEY `number_plate` (`number_plate`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='车辆表';

-- ----------------------------
-- Records of cf_car_park_car
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_car_park_car_type`
-- ----------------------------
DROP TABLE IF EXISTS `cf_car_park_car_type`;
CREATE TABLE `cf_car_park_car_type` (
  `id` varchar(64) NOT NULL,
  `name` varchar(32) NOT NULL COMMENT '名字',
  `flag_key` varchar(32) NOT NULL COMMENT '关键字',
  `image` varchar(128) NOT NULL DEFAULT '',
  `description` varchar(64) NOT NULL DEFAULT '' COMMENT '描述',
  `sort_index` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`id`),
  UNIQUE KEY `flag_key` (`flag_key`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='停车场车辆类型表';

-- ----------------------------
-- Records of cf_car_park_car_type
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_car_park_charging_rules`
-- ----------------------------
DROP TABLE IF EXISTS `cf_car_park_charging_rules`;
CREATE TABLE `cf_car_park_charging_rules` (
  `id` varchar(64) NOT NULL,
  `car_park_id` varchar(64) NOT NULL COMMENT '停车场id',
  `start_time` bigint(19) unsigned NOT NULL COMMENT '开始时间',
  `end_time` bigint(19) unsigned NOT NULL COMMENT '结束时间',
  `fee` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '实时单价',
  `create_time` bigint(19) unsigned NOT NULL COMMENT '创建时间',
  `update_time` bigint(19) unsigned NOT NULL COMMENT '更新时间',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态(0-弃用/1-启用)',
  PRIMARY KEY (`id`),
  KEY `car_park_id` (`car_park_id`,`start_time`,`end_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='停车场计费规则表';

-- ----------------------------
-- Records of cf_car_park_charging_rules
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_car_park_checkpoint`
-- ----------------------------
DROP TABLE IF EXISTS `cf_car_park_checkpoint`;
CREATE TABLE `cf_car_park_checkpoint` (
  `id` varchar(64) NOT NULL,
  `name` varchar(32) NOT NULL COMMENT '(关卡/出入口)名称',
  `car_park_id` varchar(64) NOT NULL COMMENT '停车场id',
  `position_x` decimal(16,12) NOT NULL COMMENT '卡点位置经度',
  `position_y` decimal(16,12) NOT NULL COMMENT '卡点位置纬度',
  `position_describe` varchar(64) NOT NULL DEFAULT '' COMMENT '位置描述',
  `floor` tinyint(3) NOT NULL COMMENT '所在楼层',
  `mode` tinyint(2) unsigned NOT NULL COMMENT '模式(0-完全无人值守/1-半自动/2-完全人工值守)',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '卡点状态(0-正常/1-关闭通行)',
  PRIMARY KEY (`id`),
  KEY `car_park_id` (`car_park_id`),
  KEY `position_x` (`position_x`,`position_y`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of cf_car_park_checkpoint
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_car_park_device`
-- ----------------------------
DROP TABLE IF EXISTS `cf_car_park_device`;
CREATE TABLE `cf_car_park_device` (
  `id` varchar(64) NOT NULL,
  `car_park_id` varchar(64) NOT NULL COMMENT '停车场id',
  `bar_code` varchar(64) NOT NULL DEFAULT '' COMMENT '设备条形码',
  `brand` varchar(32) NOT NULL COMMENT '品牌',
  `model` varchar(64) NOT NULL COMMENT '型号',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '1' COMMENT '0-已下线/1-正常/2-故障维护',
  `last_online_time` bigint(19) unsigned NOT NULL COMMENT '最近上线时间',
  `link_mode` varchar(32) NOT NULL COMMENT '连接模式(poll-轮询/socket-长连接)',
  `type` tinyint(2) unsigned NOT NULL COMMENT '1-匝道/2-相机',
  `checkpoint_id` varchar(64) NOT NULL COMMENT '关卡(出入口)id',
  `product_id` varchar(64) NOT NULL DEFAULT '' COMMENT '产品id',
  `direction` varchar(32) NOT NULL COMMENT '方向',
  PRIMARY KEY (`id`),
  KEY `car_park_id` (`car_park_id`),
  KEY `bar_code` (`bar_code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='停车场设备表';

-- ----------------------------
-- Records of cf_car_park_device
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_car_park_device_brand`
-- ----------------------------
DROP TABLE IF EXISTS `cf_car_park_device_brand`;
CREATE TABLE `cf_car_park_device_brand` (
  `id` varchar(64) NOT NULL,
  `name` varchar(32) NOT NULL COMMENT '设备品牌名称',
  `image` varchar(64) NOT NULL DEFAULT '' COMMENT '封面/logo',
  `sort_index` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='设备品牌表';

-- ----------------------------
-- Records of cf_car_park_device_brand
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_car_park_device_vendor`
-- ----------------------------
DROP TABLE IF EXISTS `cf_car_park_device_vendor`;
CREATE TABLE `cf_car_park_device_vendor` (
  `id` varchar(64) NOT NULL,
  `name` varchar(32) NOT NULL COMMENT '厂商名称',
  `country_id` varchar(64) NOT NULL COMMENT '所在国家',
  `province_id` varchar(64) NOT NULL DEFAULT '' COMMENT '省份id',
  `state_or_city_id` varchar(64) NOT NULL COMMENT '州或市id',
  `county_id` varchar(64) NOT NULL DEFAULT '' COMMENT '县id',
  `position_x` decimal(16,12) NOT NULL COMMENT '厂商位置经度',
  `position_y` decimal(16,12) NOT NULL COMMENT '厂商位置纬度',
  `address` varchar(64) NOT NULL,
  `introduction` text NOT NULL COMMENT '厂商简介',
  PRIMARY KEY (`id`),
  KEY `position_x` (`position_x`,`position_y`)
