-- Table structure for `cf_car_park_link_user`
-- ----------------------------
DROP TABLE IF EXISTS `cf_car_park_link_user`;
CREATE TABLE `cf_car_park_link_user` (
  `id` varchar(64) NOT NULL,
  `car_park_id` varchar(64) NOT NULL COMMENT '停车场id',
  `uid` varchar(64) NOT NULL COMMENT '用户id',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='停车场与用户关联表';

