-- ----------------------------
-- Table structure for `cf_car_park_package`
-- ----------------------------
DROP TABLE IF EXISTS `cf_car_park_package`;
CREATE TABLE `cf_car_park_package` (
  `id` varchar(64) NOT NULL,
  `car_park_id` varchar(64) NOT NULL COMMENT '停车场id',
  `type_key` varchar(32) NOT NULL COMMENT '车辆类型',
  `start_time` bigint(19) unsigned NOT NULL COMMENT '套餐开始时间',
  `end_time` bigint(19) unsigned NOT NULL COMMENT '套餐结束时间',
  `create_time` bigint(19) unsigned NOT NULL COMMENT '创建时间',
  `uid` varchar(64) NOT NULL COMMENT '用户id',
  `number_plate` varchar(16) NOT NULL COMMENT '车牌号',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`),
  KEY `car_park_id` (`car_park_id`),
  KEY `number_plate` (`number_plate`),
  KEY `start_time` (`start_time`),
  KEY `end_time` (`end_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='车辆对应车场套餐表';

-- ----------------------------
-- Records of cf_car_park_package
