-- Table structure for `cf_car_park_payment_agency`
-- ----------------------------
DROP TABLE IF EXISTS `cf_car_park_payment_agency`;
CREATE TABLE `cf_car_park_payment_agency` (
  `id` varchar(64) NOT NULL,
  `car_park_id` varchar(64) NOT NULL COMMENT '停车场id',
  `user_payment_agency` varchar(64) NOT NULL COMMENT '用户与支付机构的关联表id',
  `sort_index` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '排序值',
  PRIMARY KEY (`id`),
  KEY `car_park_id` (`car_park_id`,`user_payment_agency`,`sort_index`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='停车场支付机构关联表';

