-- Records of cf_car_park_payment_agency
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_car_park_release_log`
-- ----------------------------
DROP TABLE IF EXISTS `cf_car_park_release_log`;
CREATE TABLE `cf_car_park_release_log` (
  `id` varchar(64) NOT NULL,
  `carpark_id` varchar(64) NOT NULL COMMENT '停车场id',
  `carpark_use_log_id` varchar(64) NOT NULL DEFAULT '' COMMENT '停车记录id',
  `number_plate` varchar(16) NOT NULL DEFAULT '' COMMENT '车牌号',
  `uid` varchar(64) NOT NULL COMMENT '申请人',
  `device_serial_number` varchar(128) NOT NULL COMMENT '序列号',
  `application_time` bigint(19) unsigned NOT NULL COMMENT '申请时间',
  `application_reason` tinytext NOT NULL COMMENT '申请原因',
  `execution_time` bigint(19) unsigned NOT NULL DEFAULT '0' COMMENT '执行时间',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态(0-待执行/1-执行成功/2-执行失败)',
  PRIMARY KEY (`id`),
  KEY `device_serial_number` (`device_serial_number`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='停车场放行记录表';

-- ----------------------------
-- Records of cf_car_park_release_log
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_car_park_use_log`
-- ----------------------------
DROP TABLE IF EXISTS `cf_car_park_use_log`;
CREATE TABLE `cf_car_park_use_log` (
  `id` varchar(64) NOT NULL,
  `number_plate` varchar(16) NOT NULL COMMENT '车牌号',
  `uid` varchar(64) NOT NULL DEFAULT '' COMMENT '用户id(使用场景:申请临时通行时会标记用户)',
  `in_small_image` varchar(128) NOT NULL DEFAULT '' COMMENT '进场小图',
  `out_small_image` varchar(128) NOT NULL DEFAULT '' COMMENT '出场小图',
  `in_big_image` varchar(128) NOT NULL DEFAULT '' COMMENT '进场大图',
  `out_big_image` varchar(128) NOT NULL DEFAULT '' COMMENT '出场大图',
  `car_park_id` varchar(64) NOT NULL COMMENT '停车场id',
  `in_time` bigint(19) unsigned NOT NULL COMMENT '进场时间',
  `out_time` bigint(19) unsigned NOT NULL DEFAULT '0' COMMENT '出场时间',
  `in_release_type` tinyint(2) unsigned NOT NULL COMMENT '入场放行方式(0-未知/1-自动抬杆/2-人工抬杆/3-手机放行，断电断网时)',
  `out_release_type` tinyint(2) unsigned NOT NULL COMMENT '出场放行方式(0-未知/1-自动抬杆/2-人工抬杆/3-手机放行，断电断网时)',
  `in_check_point_id` varchar(64) NOT NULL COMMENT '入口id',
  `out_check_point_id` varchar(64) NOT NULL DEFAULT '' COMMENT '出口id',
  `create_position` varchar(16) NOT NULL COMMENT '产生该停车记录的位置(out-外场/in-内场)',
  `pay_time` bigint(19) unsigned NOT NULL DEFAULT '0' COMMENT '支付时间',
  `create_time` bigint(19) unsigned NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `number_plate` (`number_plate`),
  KEY `car_park_id` (`car_park_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='车辆出入记录';

-- ----------------------------
-- Records of cf_car_park_use_log
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_coupon`
-- ----------------------------
DROP TABLE IF EXISTS `cf_coupon`;
CREATE TABLE `cf_coupon` (
  `id` varchar(64) NOT NULL,
  `to_uid` varchar(64) NOT NULL COMMENT '受赠用户id',
  `from_uid` varchar(19) NOT NULL COMMENT '发放者id',
  `scenes` tinyint(2) unsigned NOT NULL COMMENT '使用场景(0-通用/1-停车场/2-传统商城)',
  `shop_id` varchar(64) NOT NULL DEFAULT '' COMMENT '店铺id(为空时表示不限店铺使用)',
  `goods_id` varchar(64) NOT NULL DEFAULT '' COMMENT '商品id(留空这表示不限商品)',
  `denomination` decimal(10,2) unsigned NOT NULL COMMENT '优惠券面额',
  `effective_time` bigint(19) unsigned NOT NULL COMMENT '生效时间',
  `expire_time` bigint(19) unsigned NOT NULL COMMENT '失效时间',
  `status` tinyint(3) unsigned NOT NULL COMMENT '状态(0-已使用/1-未使用/2-锁定)',
  `create_time` bigint(19) unsigned NOT NULL COMMENT '创建时间',
  `use_time` bigint(19) unsigned NOT NULL COMMENT '使用时间',
  PRIMARY KEY (`id`),
  KEY `to_uid` (`to_uid`,`effective_time`,`expire_time`,`scenes`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='优惠券表';

-- ----------------------------
-- Records of cf_coupon
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_department`
-- ----------------------------
DROP TABLE IF EXISTS `cf_department`;
CREATE TABLE `cf_department` (
  `id` varchar(64) NOT NULL COMMENT '主键',
  `name` varchar(32) NOT NULL COMMENT '部门名称',
  `icon` varchar(128) NOT NULL DEFAULT '' COMMENT '部门图标',
  `sort_index` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '顺序序号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='部门表';

-- ----------------------------
-- Records of cf_department
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_order`
-- ----------------------------
DROP TABLE IF EXISTS `cf_order`;
CREATE TABLE `cf_order` (
  `id` varchar(128) NOT NULL,
  `uid` varchar(64) NOT NULL DEFAULT '' COMMENT '用户id',
  `goods_name` varchar(128) NOT NULL COMMENT '商品名称(快照)',
  `goods_id` varchar(128) NOT NULL COMMENT '商品id',
  `goods_image` varchar(128) NOT NULL DEFAULT '' COMMENT '商品图(快照)',
  `goods_type` tinyint(3) unsigned NOT NULL COMMENT '商品类型(1-停车/2-充值或提现/3-商城/4-转账或收款)',
  `amounts_payable` decimal(10,2) unsigned NOT NULL COMMENT '应付金额',
  `amount_actually_paid` decimal(10,2) unsigned NOT NULL COMMENT '实付金额',
  `refund_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '退款金额',
  `coupon_id` varchar(128) NOT NULL DEFAULT '' COMMENT '优惠券id',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '订单状态(0-待支付/1-已支付/2-已发货/3-已取消/4-一退款中/5-已退款/6-退货中/7-已退货/8-交易成功/9-售后中/10-售后已结束)',
  `create_time` bigint(19) unsigned NOT NULL COMMENT '创建时间',
  `pay_time` bigint(19) unsigned NOT NULL DEFAULT '0' COMMENT '支付时间',
  `refund_time` bigint(19) unsigned NOT NULL DEFAULT '0' COMMENT '退款时间',
  `cancel_time` bigint(19) unsigned NOT NULL DEFAULT '0' COMMENT '取消时间',
  `payment_agency_short_name` varchar(64) NOT NULL DEFAULT '' COMMENT '支付机构(缩写之类的)',
  `third_party_order_id` varchar(64) NOT NULL DEFAULT '' COMMENT '第三方订单id',
  `effect_object` varchar(128) NOT NULL DEFAULT '' COMMENT '使用(作用)对象',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`,`goods_type`),
  KEY `uid` (`uid`,`goods_type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单表';

-- ----------------------------
-- Records of cf_order
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_payment_agency`
-- ----------------------------
DROP TABLE IF EXISTS `cf_payment_agency`;
CREATE TABLE `cf_payment_agency` (
  `id` varchar(64) NOT NULL,
  `name` varchar(64) NOT NULL COMMENT '名称',
  `short_name` varchar(32) NOT NULL COMMENT '简称(唯一标识符)',
  `image` varchar(128) NOT NULL DEFAULT '' COMMENT '图片',
  `sort_index` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '排序值',
  `score_type` varchar(32) NOT NULL COMMENT '积分类型',
  PRIMARY KEY (`id`),
  UNIQUE KEY `short_name` (`short_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='支付机构表';

-- ----------------------------
-- Records of cf_payment_agency
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_role`
-- ----------------------------
DROP TABLE IF EXISTS `cf_role`;
CREATE TABLE `cf_role` (
  `id` varchar(64) NOT NULL COMMENT '主键',
  `name` varchar(32) NOT NULL COMMENT '角色名称',
  `flag_key` varchar(32) NOT NULL COMMENT '角色关键字(英文名)',
  `department_id` varchar(64) NOT NULL COMMENT '所属部门(组)',
  `role_level` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '权限水平(用于同等角色或者不同角色具有相同权限时是否操作对方信息)',
  `icon` varchar(128) NOT NULL DEFAULT '' COMMENT '角色图标',
  `description` varchar(64) NOT NULL DEFAULT '' COMMENT '角色描述',
  PRIMARY KEY (`id`),
  KEY `department_id` (`department_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='角色表';

-- ----------------------------
-- Records of cf_role
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_role_auth`
-- ----------------------------
DROP TABLE IF EXISTS `cf_role_auth`;
CREATE TABLE `cf_role_auth` (
  `id` varchar(64) NOT NULL COMMENT '主键',
  `role_id` varchar(64) NOT NULL COMMENT ' 角色id',
  `auth_id` varchar(64) NOT NULL COMMENT '权限id',
  PRIMARY KEY (`id`),
  KEY `role_id` (`role_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='角色权限表';

-- ----------------------------
-- Records of cf_role_auth
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_score_type`
-- ----------------------------
DROP TABLE IF EXISTS `cf_score_type`;
CREATE TABLE `cf_score_type` (
  `id` varchar(64) NOT NULL,
  `name` varchar(32) NOT NULL COMMENT '积分名称',
  `key_flag` varchar(32) NOT NULL COMMENT '标识符',
  `image` varchar(128) NOT NULL DEFAULT '' COMMENT '图片',
  `currency_unit` varchar(32) NOT NULL COMMENT '货币单位',
  PRIMARY KEY (`id`),
  UNIQUE KEY `key_flag` (`key_flag`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='积分类型表';

-- ----------------------------
-- Records of cf_score_type
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_sms`
-- ----------------------------
DROP TABLE IF EXISTS `cf_sms`;
CREATE TABLE `cf_sms` (
  `id` varchar(64) NOT NULL,
  `phone` varchar(11) NOT NULL,
  `code` varchar(16) NOT NULL,
  `type` tinyint(3) unsigned NOT NULL COMMENT '短信类型(1-注册/2-身份验证/3-通知)',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0-未使用/1-已使用',
  `create_time` bigint(19) unsigned NOT NULL COMMENT '创建时间',
  `expire_time` bigint(19) unsigned NOT NULL COMMENT '过期时间',
  PRIMARY KEY (`id`),
  KEY `phone` (`phone`,`expire_time`),
  KEY `phone_2` (`phone`,`code`,`create_time`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='短信发送记录表';

-- ----------------------------
-- Records of cf_sms
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_third_party_login`
-- ----------------------------
DROP TABLE IF EXISTS `cf_third_party_login`;
CREATE TABLE `cf_third_party_login` (
  `id` varchar(64) NOT NULL,
  `uid` varchar(64) NOT NULL COMMENT '用户id',
  `openid` varchar(64) NOT NULL DEFAULT '',
  `unionid` varchar(64) NOT NULL DEFAULT '',
  `platform` varchar(32) NOT NULL COMMENT '平台(wxmp-微信小程序/wxwb-微信公众号/wxapp-微信app/toutiao-今日头条)',
  `create_time` bigint(19) unsigned NOT NULL COMMENT '创建时间',
  `main_body_id` varchar(64) NOT NULL DEFAULT '' COMMENT '主体id(每个主体账号id，例如在自己平台管理中的公众号id)',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`,`platform`),
  KEY `platform` (`platform`,`unionid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='第三方用户认证记录';

-- ----------------------------
-- Records of cf_third_party_login
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_transfer_log`
-- ----------------------------
DROP TABLE IF EXISTS `cf_transfer_log`;
CREATE TABLE `cf_transfer_log` (
  `id` varchar(64) NOT NULL,
  `from_uid` varchar(64) NOT NULL COMMENT '转账用户id',
  `to_uid` varchar(64) NOT NULL COMMENT '收款用户id',
  `value` decimal(10,2) NOT NULL COMMENT '金额',
  `status` tinyint(2) unsigned NOT NULL COMMENT '状态(0-已取消/1-进行中/2-已完成/3-已取消/4-失败)',
  `create_time` bigint(19) unsigned NOT NULL COMMENT '产生时间',
  PRIMARY KEY (`id`),
  KEY `from_uid` (`from_uid`),
  KEY `to_uid` (`to_uid`),
  KEY `create_time` (`create_time`,`value`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='转账记录表';

-- ----------------------------
-- Records of cf_transfer_log
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_user`
-- ----------------------------
DROP TABLE IF EXISTS `cf_user`;
CREATE TABLE `cf_user` (
  `id` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '用户主键id',
  `user_name` varchar(32) CHARACTER SET utf8 NOT NULL COMMENT '用户名',
  `password` varchar(128) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '用户密码',
  `avatar` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '用户头像',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '用户类型',
  `nick_name` varchar(32) NOT NULL DEFAULT '' COMMENT '用户昵称',
  `true_name` varchar(32) NOT NULL DEFAULT '' COMMENT '用户真实姓名',
  `phone` varchar(11) NOT NULL COMMENT '手机号',
  `email` varchar(64) DEFAULT '' COMMENT '邮箱',
  `birthday` bigint(19) unsigned NOT NULL DEFAULT '0' COMMENT '生日，用户计算年龄',
  `sex` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '性别(0-保密/1-男/2-女)',
  `sign` varchar(64) NOT NULL DEFAULT '' COMMENT '个性签名',
  `create_time` bigint(19) unsigned NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `user_name` (`user_name`),
  KEY `email` (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='用户表';

-- ----------------------------
-- Records of cf_user
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_user_auth`
-- ----------------------------
DROP TABLE IF EXISTS `cf_user_auth`;
CREATE TABLE `cf_user_auth` (
  `id` varchar(64) NOT NULL COMMENT '主键',
  `uid` varchar(64) NOT NULL COMMENT '管理员id',
  `auth_id` varchar(64) NOT NULL COMMENT '权限id',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='管理员权限表';

-- ----------------------------
-- Records of cf_user_auth
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_user_friend`
-- ----------------------------
DROP TABLE IF EXISTS `cf_user_friend`;
CREATE TABLE `cf_user_friend` (
  `id` varchar(64) NOT NULL,
  `uid` varchar(64) NOT NULL COMMENT '用户id',
  `friend_id` varchar(64) NOT NULL COMMENT '朋友id',
  `create_time` bigint(19) unsigned NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户好友表';

-- ----------------------------
-- Records of cf_user_friend
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_user_friend_add_log`
-- ----------------------------
DROP TABLE IF EXISTS `cf_user_friend_add_log`;
CREATE TABLE `cf_user_friend_add_log` (
  `id` varchar(64) NOT NULL,
  `from_uid` varchar(64) NOT NULL COMMENT ' 申请者记录',
  `to_uid` varchar(64) NOT NULL DEFAULT '' COMMENT '目标用户id',
  `group_id` varchar(64) NOT NULL DEFAULT '' COMMENT '群id',
  `create_time` bigint(19) unsigned NOT NULL,
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态(0-等待处理/1-已通过/2-已拒绝3-已忽略)',
  `remark` varchar(32) NOT NULL DEFAULT '' COMMENT '添加备注',
  `type` tinyint(1) unsigned NOT NULL COMMENT '记录类型(1-主动申请/2-邀请)',
  PRIMARY KEY (`id`),
  KEY `from_uid` (`from_uid`,`to_uid`,`create_time`),
  KEY `from_uid_2` (`from_uid`,`group_id`,`create_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='好友(群)申请记录表';

-- ----------------------------
-- Records of cf_user_friend_add_log
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_user_group`
-- ----------------------------
DROP TABLE IF EXISTS `cf_user_group`;
CREATE TABLE `cf_user_group` (
  `id` varchar(64) NOT NULL,
  `name` varchar(32) NOT NULL COMMENT '群名称',
  `avatar` varchar(128) NOT NULL DEFAULT '' COMMENT '群头像',
  `announcement` text NOT NULL COMMENT '群公告或描述',
  `people` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '群人数',
  `people_cap` smallint(5) unsigned NOT NULL DEFAULT '500' COMMENT '群成员上限',
  `level` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '群等级(星级)',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '群状态(0-正常/1-存在违规内容/2-封群)',
  `creater_id` varchar(64) NOT NULL COMMENT '创建者uid',
  `create_time` bigint(19) unsigned NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='聊天群';

-- ----------------------------
-- Records of cf_user_group
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_user_group_member`
-- ----------------------------
DROP TABLE IF EXISTS `cf_user_group_member`;
CREATE TABLE `cf_user_group_member` (
  `id` varchar(64) NOT NULL,
  `group_id` varchar(64) NOT NULL COMMENT '群组id',
  `uid` varchar(64) NOT NULL COMMENT '用户id',
  `level` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '群内等级/职位(0-普通成员/1-管理员/2-群主)',
  `nick_name` varchar(32) CHARACTER SET utf8mb4 NOT NULL COMMENT '群昵称',
  `join_type` tinyint(1) unsigned NOT NULL COMMENT '入群方式(0-创建者自动入驻/1-主动申请/2-邀请)',
  `join_time` bigint(19) unsigned NOT NULL COMMENT '入群时间',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态(1-正常/2-已退群/3-被踢出群)',
  `muted_deadline` bigint(19) NOT NULL DEFAULT '0' COMMENT '禁言截止时间',
  PRIMARY KEY (`id`),
  KEY `group_id` (`group_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='群成员表';

-- ----------------------------
-- Records of cf_user_group_member
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_user_message`
-- ----------------------------
DROP TABLE IF EXISTS `cf_user_message`;
CREATE TABLE `cf_user_message` (
  `id` varchar(64) NOT NULL,
  `from_uid` varchar(64) NOT NULL COMMENT '发送者',
  `to_uid` varchar(64) NOT NULL COMMENT '接收者id',
  `group_id` varchar(64) NOT NULL DEFAULT '' COMMENT '组id',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态(0-未读/1-已读/2-已撤回/3-违规消息)',
  `contents` varchar(256) NOT NULL COMMENT '消息内容',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '消息类型(0-文本/1-文件/2-视频/3-链接)',
  `client` tinyint(1) unsigned NOT NULL COMMENT '客户端类型(0-app/1-PC/2-PC浏览器/3-手机web)',
  `ip` varchar(128) NOT NULL DEFAULT '' COMMENT '发送ip',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `receive_time` int(11) NOT NULL COMMENT '接收的时间',
  PRIMARY KEY (`id`),
  KEY `from_uid` (`from_uid`,`to_uid`,`status`,`create_time`),
  KEY `group_id` (`group_id`,`status`,`create_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='消息表';

-- ----------------------------
-- Records of cf_user_message
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_user_payment_agency`
-- ----------------------------
DROP TABLE IF EXISTS `cf_user_payment_agency`;
CREATE TABLE `cf_user_payment_agency` (
  `id` varchar(64) NOT NULL,
  `name` varchar(32) NOT NULL COMMENT ' 机构名称',
  `uid` varchar(64) NOT NULL COMMENT '用户id',
  `payment_agency_short_name` varchar(64) NOT NULL COMMENT '机构缩写',
  `pay_key` varchar(128) NOT NULL DEFAULT '' COMMENT 'key私钥',
  `secret` varchar(128) NOT NULL DEFAULT '',
  `appid` varchar(128) NOT NULL DEFAULT '',
  `account_number_note` tinytext NOT NULL COMMENT '账号备注',
  `mch_id` varchar(64) NOT NULL DEFAULT '' COMMENT '商户号',
  `cert_path` varchar(64) NOT NULL DEFAULT '' COMMENT '证书路径',
  `pay_notify_url` varchar(128) NOT NULL COMMENT '支付通知地址',
  `refund_pay_notify_url` varchar(128) NOT NULL COMMENT '支付退款通知地址',
  `use_scenes` varchar(32) NOT NULL DEFAULT '' COMMENT '使用场景(wx_web微信网页/app/ali_web阿里网页/web-网页通用)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uid` (`uid`,`payment_agency_short_name`,`use_scenes`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户支付机构表';

-- ----------------------------
-- Records of cf_user_payment_agency
-- ----------------------------

-- ----------------------------
-- Table structure for `cf_user_role`
-- ----------------------------
DROP TABLE IF EXISTS `cf_user_role`;
CREATE TABLE `cf_user_role` (
  `id` varchar(64) NOT NULL COMMENT '主键',
  `uid` varchar(64) NOT NULL COMMENT '管理员id',
  `role_id` varchar(64) NOT NULL COMMENT '角色id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='管理员角色表';

-- ----------------------------
-- Records of cf_user_role
-- ----------------------------

